import json


class VDOM_datatable_v4(VDOM_object):

  def render(self, contents=""):

    idn = (self.id).replace('-', '_')
    id = u'o_' + idn
    id_table = u't_' + id

    display = u" display:none; " if self.visible == "0" else u""

    style = u"""{display}z-index: {zind}; position: absolute; top: {top}px; left: {left}px; height: {height}px; width: {width}px"""\
      .format(display = display, zind = self.zindex, top = self.top, left = self.left, height = self.height, width = self.width)

    cssclass = u'class="datatablev4 {usercss} {multiselect} {tristate}"'.format(
        usercss     = (self.cssclass).replace('"', '') if self.cssclass else "",
        multiselect = u"multiselect" if self.selectionmode == "1" else "",
        tristate    = u"tristate" if self.tristate == "1" else "" )

    if self.header:
      try:
        header = json.loads(self.header)
        if isinstance(header, int):
          raise Exception (u"Incorrect value in header %s" % self.header)
        else:
          col_title = []
          for i in header:
            col_title.append({u"title": i})
      except:
        raise Exception (u"Incorrect value in header %s" % self.header)
    else:
      col_title = []

    if self.data:
      try:
        src_data = json.loads(self.data)
        if isinstance(src_data, int):
          raise Exception (u"Incorrect value in data %s" % self.data)
      except:
        raise Exception (u"Incorrect value in data %s" % self.data)
    else:
      src_data = [[]]

    if self.key and not self.customcolumns:
      if self.key in [_['title'] for _ in col_title]:
        self.customcolumns = """{
        'targets': 0,
        'className': 'hide_column',
        'createdCell':  function (td, cellData, rowData, row, col) {
        $(td).css({'display': 'none'})
        $(td).attr('data-key',cellData); 
      }
    }"""
    elif self.key and self.customcolumns:
      if self.key in [_['title'] for _ in col_title]:
        self.customcolumns += """{
        'targets': 0,
        'className': 'hide_column',
        'createdCell':  function (td, cellData, rowData, row, col) {
        $(td).css({'display': 'none'})
        $(td).attr('data-key',cellData); 
      }
    }"""

    if self.fixedheight == "1":
      fixed_height = u"""height = "%(height)spx" """% {"height": self.height}
    else:
      fixed_height = u""

    if self.showheader == "1":
      show_header = u""
    else:
      show_header = u"""
      "drawCallback": function() {
          $("#%(id_table)s thead").remove(); 
        },
""" % {"id_table": id_table}

    if self.scrollY != "0":
      scroll = u'"scrollY": "%(scrollY)spx",\n"scrollCollapse": true,\n' % {"scrollY": self.scrollY}
    else:
      scroll = ""

    if self.pagelength:
      page_length = u"""
      "pageLength": %(pagelength)s,
""" % {"pagelength": self.pagelength}
    else:
      page_length = u""

    if self.splittable == "0":
      paging = u'"paging": false,'
    else:
      paging = u""

    if self.searching == "0":
      searching = u'"searching": false,'
    else:
      searching = u""

    if self.title:
      title = u"""$('#%(id_table)s').append('<caption style="caption-side: top-right">%(title)s</caption>');
      """ % {"title": self.title, "id_table": id_table}
    else:
      title = u""

    if self.selectionmode == "0":
      slelection_mode = u"""
      $('#%(id_table)s tbody').on( 'click', 'tr', function () {
            if ( $(this).hasClass('selected') ) {
                $(this).removeClass('selected');
                execEventBinded('%(idn)s', 'rowsunselected', {});
            }
            else {
                table.$('tr.selected').removeClass('selected');
                const idy = table.row( this ).index()
                const element = $(this);
                const key_column = element.children()[0];
                let key = $(key_column).attr('data-key');
                if (key == null) {
                  key = idy;
                }
          execEventBinded('%(idn)s', 'rowsselected', {keyList: key});
                $(this).addClass('selected');
            }
        } );

        $('#button').click( function () {
            table.row('.selected').remove().draw( false );
        } );
""" % {"id_table": id_table, "idn": idn}
    else:
      slelection_mode = u"""
      $('#%(id_table)s tbody').on( 'click', 'tr', function () {
            $(this).toggleClass('selected');
        execEventBinded('%(idn)s', 'rowsselected', {keyList: table.row( this ).index()});
      } );

        $('#button').click( function () {
            alert( table.rows('.selected').data().length +' row(s) selected' );
        } );
""" % {"id_table": id_table, "idn": idn}

    if self.selectedrows:
      try:
        json.loads(self.selectedrows)
        selectedrows = u"""
          const mas  = %(selectedrows)s;
          const _table = this.api();
          mas.forEach(function(id) {
            $(_table.row( id ).node()).addClass('selected');
          });
""" % {"id_table": id_table, "selectedrows": self.selectedrows}
      except:
        raise Exception (u"Incorrect value in selectedrows %s" % self.selectedrows)
    else:
      selectedrows = u""

    if VDOM_CONFIG_1["DEBUG"] == "1":
      debug_info = u"objtype='%s' objname='%s' ver='%s'" % (self.type.name, self.name, self.type.version)
    else:
      debug_info = u""

    result = u"""
    <div %(debug_info)s id='%(id)s' style='%(style)s' %(cssclass)s>
  <style type="text/css">
    %(selfstyle)s
  </style>
    <table id="%(id_table)s" class="display" width="100%%" %(fixed_height)s>
    </table>
  <script type="text/javascript">

    $(document).ready(function(){
      var id_%(id)s = '%(id)s';
      const table = $('#%(id_table)s').DataTable({
        data: %(data)s,
        columns: %(columns)s,
        "order": [],
        %(paging)s
        %(searching)s
        %(scroll)s
        %(page_length)s
        %(show_header)s
        "columnDefs": [%(customcolumns)s],
        initComplete : function() {
          %(selectedrows)s
        },
        %(customparams)s
        // NOTE: Hides pagination panel if there's only one page
        "fnDrawCallback": function(oSettings) {
        	if (oSettings._iDisplayLength == -1 || oSettings._iDisplayLength > oSettings.fnRecordsDisplay()) {
            	jQuery(oSettings.nTableWrapper).find('.dataTables_paginate').addClass('datatable-pagination-disable');
        	} else {
        	    jQuery(oSettings.nTableWrapper).find('.dataTables_paginate').removeClass('datatable-pagination-disable');
        	}
    	}
      });

      $('#%(id)s').find('.dataTable')
      	.wrap("<div class='table_wrapper'></div>");

      %(title)s

      $.fn.dataTable.Api.register( 'column().title()', function () {
        var colheader = this.header();
        return $(colheader).text().trim();
      } );

      $('#%(id_table)s tbody').on( 'click', 'td', function () {
        const idx = table.cell( this ).index().column;
        const idy = table.cell( this ).index().row;
        const title = table.column( idx ).title();
        const el = $(this);
        const parent = el.parent();
        const first_col = parent.children()[0];
        let key = $(first_col).attr('data-key');
        if (key == null) {
            key = idy;
        }
        execEventBinded('%(idn)s', 'cellclick', {keyField: key, cellData:table.row( idy ).data(), headerData:title});
      } );

      $('#%(id_table)s tbody').on( 'dblclick', 'td', function () {
        const idx = table.cell( this ).index().column;
        const idy = table.cell( this ).index().row;
        const title = table.column( idx ).title();
        const el = $(this);
        const parent = el.parent();
        const first_col = parent.children()[0];
        let key = $(first_col).attr('data-key');
        if (key == null) {
            key = idy;
        }
        execEventBinded('%(idn)s', 'celldblclick', {keyField: key, cellData:table.row( idy ).data(), headerData:title});
      } );

      %(customfunc)s
      %(selection_mode)s
      execEventBinded('%(idn)s', 'load', {width:$q('#%(id)s').outerWidth(),height:$q('#%(id)s').outerHeight()});
    });
  </script>
</div>
""" % {
        "debug_info":      debug_info,
        "id":              id,
        "idn":             idn,
        "id_table":        id_table,
        "customcolumns":   self.customcolumns,
        "show_header":     show_header,
        "page_length":     page_length,
        "paging":          paging,
        "searching":       searching,
        "selection_mode":  slelection_mode,
        "selectedrows":    selectedrows,
        "scroll":          scroll,
        "style":           style,
        "selfstyle":       self.style % {"id": id},
        "cssclass":        cssclass,
        "title":           title,
        "fixed_height":    fixed_height,
        "customparams":    self.customparams,
        "customfunc":      self.customfunc,
        "data":            json.dumps(src_data),
        "columns":         json.dumps(col_title)
    }

    return VDOM_object.render(self, contents=result)


  def wysiwyg(self, contents=""):
    from scripting.legacy.wysiwyg import get_empty_wysiwyg_value

    # parse data
    try:
      header = json.loads(self.header)
    except:
      header = []

    try:
      src_data = json.loads(self.data)
    except:
      src_data = []

    data = []
    theader = ""
    tdata = ""

    if len(src_data) == 0 and len(header) == 0:
      image_id = "f7e008b4-3eef-3269-b004-089c613a538b"

      result = get_empty_wysiwyg_value(self, image_id)

      return VDOM_object.wysiwyg(self, contents=result)


    # collect data
    for value in src_data:
      if isinstance(value, list) and len(header) == len(value):
        row = dict(zip(header, value))
        data.append(row)
      else:
        data.append(value)

    # generate table header
    for colname in header:
      theader += \
        u"""<cell backgroundcolor="#f0f0f0" bordercolor="#000000" borderwidth="1">
            <text fontsize="14" color="#000000" textalign="center">
              {colname}
            </text>
          </cell>""".format(colname = unicode(colname))

    # generate table data
    for row in data:
      tdata += u"""<row backgroundcolor="#f0f0f0" bordercolor="#000000" borderwidth="1">"""
      if header and len(header) == len(row):
        for col in header:
          tdata += \
            u"""<cell backgroundcolor="#f0f0f0" bordercolor="#000000" borderwidth="1">
                <text fontsize="12" color="#000000" textalign="center">
                  {cell_data}
                </text>
              </cell>""".format(cell_data = unicode(row[col]))
      else:
        for val in row:
          tdata += \
            u"""<cell backgroundcolor="#f0f0f0" bordercolor="#000000" borderwidth="1">
                <text fontsize="12" color="#000000" textalign="center">
                  {cell_data}
                </text>
              </cell>""".format(cell_data = unicode(val))

      tdata += u"</row>"

    # collect result
    result = \
      u"""<container name="{name}" id="{id}" zindex="{zindex}" hierarchy="{hierarchy}" top="{top}" left="{left}" width="{width}" height="{height}">
          <table zindex="{zindex}" top="0" left="0" width="{width}" height="{height}" backgroundcolor="#f0f0f0" bordercolor="#000000" borderwidth="1" >
            <row backgroundcolor="#f0f0f0" bordercolor="#000000" borderwidth="1">
              {theader}
            </row>
            {tdata}
          </table>
          {contents}
        </container>
      """.format(
          id = self.id,
          zindex = self.zindex,
          hierarchy = self.hierarchy,
          top = self.top, left = self.left,
          width = self.width, height = self.height,
          theader = theader,
          tdata = tdata,
          contents = contents,
          name = self.name)

    return VDOM_object.wysiwyg(self, contents=result)


