}
#%(id)s .row_selected {
  background: #effdff !important;
}
"""
  pro_suite = """
#%(id)s table{
  height: 0 !important;
  border-collapse: collapse;
  border: none;
  margin-top: 10px;
}
#%(id)s caption{
  text-align: left;
